import React from 'react'

const TodoFinished = ({handleModal}) => {
    return (
        <div className="contentTodoFInished" onClick={()=>{handleModal}}>
            <div className="contentTaskEnd">
                <h1>finished</h1>
                <hr />
            </div>
        </div>
    )
}

export default TodoFinished
